import React, {useEffect} from "react";

export const Messages = ({ messages, form }) => {
  const messageClassName =
    "message" + (messages.user === form.user ? "-green" : "");

  useEffect(() => {
      console.log(messages)
  })


  return (
    <div className={`${messageClassName}  my-2 w-25`}>
      <p className="text-primary mx-2 my-2">{messages.user}</p>
      <div className="">{messages.title}</div>
      <div className="text-end">{messages.date}</div>
    </div>
  );
};
